from(bucket: "duck_bucket")
  |> range(start: v.timeRangeStart, stop:v.timeRangeStop)
  |> filter(fn: (r) =>
    r._measurement == "temp" and
    r._field == "temp"
    )
  |> aggregateWindow(
    every: duration(v: uint(v: (int(v: v.windowPeriod) * 1))),
    fn: mean,
    createEmpty: false
  )
  |> yield(name: "mean")

