    )
  |> aggregateWindow(
    every: duration(v: uint(v: (int(v: v.windowPeriod) * 1))),
    fn: mean,
    createEmpty: false
  )
  |> map(fn: (r) => ({ r with _value: float(v: 100) - (float(v: r._value) * float(v: 1)) }))
  |> yield(name: "mean")

